import React, { Component } from 'react';

import Footer from '../Components/Footer'
import Header from '../Components/Header'

class Home extends Component{
    constructor(props){
        super(props)
    }
    render(){
        return(
            <>
                <Header/>
                <Footer/>
            </>
        )
    }
}

export default Home
